t;/td&gt;\r\n&lt;td&gt;%patient_fullname% - DENTAL DEVICE TREATMENT RESULTS&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td width=&quot;50px&quot;&gt;DOB:&lt;/td&gt;\r\n&lt;td&gt;%patient_dob%&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;p&gt;Dear Dr. %contact_lastname%:&lt;/p&gt;\r\n&lt;p&gt;I write regarding our mutual Patient, %patient_fullname%. As you will please recall, %patient_firstname% is a %patient_age% year old %patient_gender% who scored an AHI of %contact_email% and/or RDI of %contact_email% after undergoing a %type_study% done at the %contact_email%. %He/She% spent %contact_email% % of the night below 90% sp O2, and had an O2 nadir of %contact_email%.&lt;/p&gt;\r\n&lt;p&gt;We delivered %contact_email% device on %delivery_date%, and %he/she% has reported doing well with it. I write to give you a progress update after the initial titration period and following a take home sleep study. %patient_firstname%\'s results, baseline and post appliance insertion appear below.&lt;/p&gt;\r\n&lt;table cellpadding=&quot;7px&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;&lt;th&gt;OBJECTIVE&lt;/th&gt;&lt;th&gt;Before&lt;/th&gt;&lt;th&gt;%contact_email%&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/th&gt;&lt;th&gt;After&lt;/th&gt;&lt;th&gt;&amp;nbsp;&lt;/th&gt;&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;RDI / AHI&lt;/td&gt;\r\n&lt;td style=&quot;text-align: center;&quot; colspan=&quot;2&quot;&gt;%1stRDI/AHI%&lt;/td&gt;\r\n&lt;td style=&quot;text-align: center;&quot; colspan=&quot;2&quot;&gt;%1stRDI/AHI%&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;Low O2&lt;/td&gt;\r\n&lt;td style=&quot;text-align: center;&quot; colspan=&quot;2&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n&lt;td style=&quot;text-align: center;&quot; colspan=&quot;2&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td&gt;T O2 &amp;le; 90%&lt;/td&gt;\r\n&lt;td style=&quot;text-align: center;&quot; colspan=&quot;2&quot;&gt;&amp;nbsp;&lt;/td&gt;\r\n&lt;td style=&quot;text-align: 